siEx cFastXmlNamedNodeMap::clsInvoke(iScr* pthis, iCtx* ctx, int index, int argc,
           const Var* argv, Var* rval)
{
      siEx ex;
      cFastXmlNamedNodeMap* pthis1 = (cFastXmlNamedNodeMap*) pthis;

      switch(index) {
         case 0:
            if (argc != 1)
               return o3_new(cEx)("Invalid argument count. ( __query__ )");
            *rval = pthis1->__query__(argv[0].toInt32());
            break;
         case 1:
            if (argc != 1)
               return o3_new(cEx)("Invalid argument count. ( __deleter__ )");
            *rval = pthis1->__deleter__(argv[0].toInt32(),&ex);
            break;
         case 2:
            if (argc != 1)
               return o3_new(cEx)("Invalid argument count. ( __getter__ )");
            *rval = pthis1->__getter__(argv[0].toInt32(),&ex);
            break;
         case 3:
            if (argc != 1)
               return o3_new(cEx)("Invalid argument count. ( getNamedItem )");
            *rval = siXmlNode(pthis1->getNamedItem(argv[0].toStr()));
            break;
         case 4:
            if (argc != 1)
               return o3_new(cEx)("Invalid argument count. ( setNamedItem )");
            *rval = siXmlNode(pthis1->setNamedItem(siXmlNode (argv[0].toScr())));
            break;
         case 5:
            if (argc != 1)
               return o3_new(cEx)("Invalid argument count. ( removeNamedItem )");
            *rval = siXmlNode(pthis1->removeNamedItem(argv[0].toStr()));
            break;
         case 6:
            if (argc != 0)
               return o3_new(cEx)("Invalid argument count. ( length )");
            *rval = pthis1->length();
            break;
      }
      return ex;
}

